// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.8.10;

contract VaccineCredential {
    address private issuerAddress;
    uint256 private idCount;
    mapping(uint8 => string) private vaccineEnum;

    struct Credential {
        uint256 id;
        address issuer;
        uint8 vaccineType;
        string value;
    }

    mapping(address => Credential) private credentials;

    constructor() {
        issuerAddress = msg.sender;
        idCount = 1;
        vaccineEnum[0] = "Pfizer";
        vaccineEnum[1] = "Moderna";
        vaccineEnum[2] = "AstraZeneca";
        vaccineEnum[3] = "Janssen";
    }

    function claimCredential(address _applicantAddress, uint8 _vaccineType, string calldata _value) public returns(bool) {
        require(issuerAddress == msg.sender, "Not Issuer");
        Credential storage credential = credentials[_applicantAddress];
        require(credential.id == 0);
        credential.id = idCount;
        credential.issuer = msg.sender;
        credential.vaccineType = _vaccineType;
        credential.value = _value;

        idCount += 1;

    }
}

